import React from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import BarreDashboardEmploye from '../composants/BarreDashboardEmploye';
import Navigation from '../composants/Navigation';
import Footer from '../composants/Footer';
import axios from 'axios';
import { useState, useEffect } from 'react';

const DetailsAjoutNourritureAnimaux = () => {
    const navigate = useNavigate();

    const [data, setData] = useState([]);
    const { id } = useParams();
    const [dataAnimal, setDataAnimal] = useState([]);

    const idNombre = Number(id);

    const loadData = async () => {
        const response = await axios.get("http://localhost:3002/animaux");
        setData(response.data);
    };

    useEffect(() => {
        loadData();
    }, []);

    useEffect(() => {
        if (data.length > 0) {
            setDataAnimal(data.find(animal => animal.id === idNombre));
        }
    }, [data]);

    const [animal, setAnimal] = useState({
        id: "",
        prenom: "",
        race: "",
        habitat: "",
        image: "",
        description: "",
        nourriture: "",
        quantite_nourriture: "",
        etat: "",
        date_nourriture: ""
    });

    useEffect(() => {
        setAnimal(dataAnimal)
    }, [dataAnimal]);

    const inputChangement = (e) => {
        const { name, value } = e.target;

        const nouvelleValeur = value;

        setAnimal({
            ...animal,
            [name]: nouvelleValeur,
        });
    };

    const AjouterNourritureAnimaux = async (e) => {
        e.preventDefault();

        try {
            await axios.put(`http://localhost:3002/animaux/modifier/${id}`, formData, { headers })
        } catch (error) {
            console.log(error);
        }
    };

    const retourDashboardEmploye = () => {
        navigate("/dashboard-employe");
    }

    return (
        <div>
            <div className="dashboard">
                <div>
                    <BarreDashboardEmploye />
                </div>
                <div>
                    <Navigation />
                    <div className="centrer">
                        <form className="formulaire">
                            <legend>Ajouter nourriture {animal.prenom}</legend>
                            <input
                                type="text"
                                name="prenom"
                                className="champsFormulaire"
                                id="prenom"
                                placeholder="Prénom..."
                                defaultValue={animal.prenom}
                                //value={animal.prenom}
                                onChange={inputChangement}
                            />
                            <label htmlFor="prenom"></label>

                            <input
                                type="text"
                                name="race"
                                className="champsFormulaire"
                                id="race"
                                placeholder="Race..."
                                defaultValue={animal.race}
                                //value={animal.race}
                                onChange={inputChangement}
                            />
                            <label htmlFor="race"></label>

                            <input
                                type="text"
                                name="habitat"
                                className="champsFormulaire"
                                id="habitat"
                                placeholder="Habitat..."
                                defaultValue={animal.habitat}
                                //value={animal.habitat}
                                onChange={inputChangement}
                            />
                            <label htmlFor="habitat"></label>

                            <textarea
                                name="description"
                                className="champsFormulaire"
                                id="description"
                                placeholder="Description..."
                                defaultValue={animal.description}
                                //value={animal.description}
                                onChange={inputChangement}
                            />
                            <label htmlFor="description"></label>

                            <div className="centrer">
                                <button type="submit" className="bouton_zoo" onClick={AjouterNourritureAnimaux}>Confirmer</button>
                                <button className="bouton_zoo" onClick={retourDashboardEmploye}>Annuler</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
};

export default DetailsAjoutNourritureAnimaux;
